import React from 'react';
import { CardImg } from 'react-bootstrap';
import AppNavBar from '../layouts/AppNavbar';
import logo from "./../img/freely-logo-final.png";
export default function Download() {
	const gotoLinkPlay = () => {
		window.open("https://play.google.com/store/apps/details?id=com.freellyapp", "_blank");
			};

			const gotoLinkIos = () => {
				window.open("https://apps.apple.com/us/app/freelly-bikepool-carpool/id6476261777", "_blank");
					};



	return (
		<div style={{display: 'flex',
			alignItems: 'center',
			justifyContent: 'center',
			height: '100vh',

		}}>
			<AppNavBar/>


		<div style={{border:"1px solid red"}} className="mt-5 mb-5  justify-content-center align-items-center">
		<div style={{
			display: 'flex',
				alignItems: 'center',
				justifyContent: 'center',
		marginTop:120,
		border:"1px solid red"

		}}>
		<CardImg
			alt="Card image cap"
			bottom
			src={logo}
			style={{
				width:"40%",

			}}
			/>
		</div>
			<h2 style={{border:"1px solid red"}} className='text-center'>Freelly অ্যাপ ডাউনলোড করতে নিচের লিংকগুলো ভিজিট করুন </h2>
			<div style={{border:"1px solid red",}} className="mt-5 dis justify-content-center align-items-center ">
			<button className="downloadApp-banner-play" onClick={gotoLinkPlay}></button>
			<button className="downloadApp-banner-ios" onClick={gotoLinkIos}></button>
			</div>
			</div>

		</div>
	)
}
